import logo from './logo.svg';
import './App.css';
import { useDispatch } from 'react-redux';
import { Get_Product } from './services/redux/Actions';
import { useEffect } from 'react';

function App() {
  const dispatch = useDispatch()
  useEffect(() => {
    dispatch(Get_Product())
  }, [])

  return (
    <div className="App">
      Nothing
    </div>
  );
}

export default App;
